Tony Stark heeft vijf kinderen van de originele Avengers opgevoed. Hun zorgeloze leventje wordt verstoord als een beschadigde Vision op het eiland neerkomt. Wanneer hij deze probeert te redden, activeert Tony per ongeluk een groep van 'Iron Avengers', die er voor zorgt dat Tony zijn basis wordt ontdekt. Tony wordt gekidnapt, maar de kinderen weten allen te ontsnappen. Zij besluiten om Tony te gaan redden.:
